package: "github.com/errordeveloper/kubegen"
import:
- package: "k8s.io/client-go"
  version: "1679e38db83a0dbe1ef86deab577eead47ce75e2"
  subpackages:
  - kubernetes
  - pkg/api/unversioned
  - pkg/api/v1
  - pkg/apis/extensions/v1beta1
  - tools/clientcmd
- package: "k8s.io/apimachinery"
  version: "21807b270ec15d19215659a5caa08b17f66d6f44"
  subpackages:
  - pkg/api/resource
  - pkg/apis/meta/v1
  - pkg/runtime
  - pkg/util/intstr
- package: "github.com/spf13/cobra"
- package: "github.com/hashicorp/hcl"
- package: "github.com/docker/docker/pkg/term"
  version: "40af569"
- package: "github.com/d4l3k/go-highlight"
  repo: "https://github.com/errordeveloper/go-highlight"
  version: "ce3036b16fa0fdcee2a3f3a58d15c377a9b60093"
- package: "github.com/jinzhu/copier"
  version: "8bfca8a"
- package: "github.com/ulule/deepcopier"
  version: "4a5401c"
- package: "github.com/equinox-io/equinox"
- package: "github.com/davecgh/go-spew"
  # must be set here to enforce what we need for testify
  # and not what client-go pulls in
  version: "04cdfd42973bb9c8589fd6a731800cf222fde1a9"
  subpackages: [spew]
testImports:
- package: "github.com/errordeveloper/testcli"
- package: "github.com/stretchr/testify"
